import React from 'react';
import axios from 'axios';

import styles from '../Navbar.module.css';

class Task1 extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
          isFetching: false
        };
      }

    render() {
        return (
        <main>
            {
                (this.state.isFetching) ? <div className={styles.loadingPane}> Fetching... </div> : (<span>xd</span>)
            }
            Task1
        </main>
        )}
}

export default Task1;
